<#
    Title:
        Windows Forensic Triage Collector

    Version:
        1.0
    
    Author:
        Gary Contreras (TheOffensiveDefender - 0x0D)

    Requirements:
        Run this script with elevated (admin) privileges
    
    Description:
        
        This script will pull forensic artifacts from a host machine and drop them in the following folder:

        C:\ForensicTriage

    Notes:

    - The list of artifacts currently pulled are based off of the SANS "Windows Forensic Analysis" poster.
    - Uses WinPmem (Release 4.0 RC2) to collect an image of physical memory.
            https://github.com/Velocidex/WinPmem/releases
    - Windows Management Instrumentation (WMI) is used for a lot of the generalized system enumeration.
    - Uses Volume Shadow Copy to pull "locked" files.
    - The C: drive Master File Table (MFT) is pulled with a modified version of Jesse "secabstraction" Davis' 
      "Export-MFT" functionality; props to him for his work!
            https://gist.github.com/secabstraction/4044f4aadd3ef21f0ca9
#>

#Requires -RunAsAdministrator

# Start script
Write-output "`n[*] Script started at $(([datetime]::UtcNow).tostring())`n"

# Set an output path and create it
$outputbase = 'C:\ForensicTriage'

if (!(Test-Path $outputbase)) {
    #write-output "[*] Creating Directory $outputbase`n"
    new-item $outputbase -itemtype 'directory' -force | out-null
}
else {
    remove-item $outputbase -force -recurse
    #write-output "[*] Creating Directory $outputbase`n"
    new-item $outputbase -itemtype 'directory' -force | out-null
}

# Subdirectories to create
$outputsubdirs = @(
    '\System',
    '\Network',
    '\Users',
    '\Interesting',
    '\Registry',
    '\Eventlogs',
    '\Filesystem',
    '\Memory',
    '\Tools'
)

# Create subdirectories
foreach ($sd in $outputsubdirs) {
    $tp = $outputbase + $sd

    if (!(test-path $tp)) {
        #write-output "[*] Creating Directory $tp`n"
        new-item -path $tp -itemtype 'directory' -force | out-null
    }
    else {
        remove-item $tp -force -recurse
        #write-output "[*] Creating Directory $tp`n"
        new-item -path $tp -itemtype 'directory' -force | out-null
    }
}

# Get a memory dump with WinPmemn
$ts = [datetime]::UtcNow
$oppath = $outputbase + '\Memory\' + $($ts.year) + '-' + $($ts.month) + '-' + $($ts.day) + '_' + $($ts.hour) + '_' + $($ts.minute) + '_' + $($ts.second) + '-' + $($env:COMPUTERNAME) + '_MemoryDump.mem'
$wpmempath = $outputbase + '\Tools\winpmem_mini_x64_rc2.exe'
$wpmem = ''
[io.file]::writeallbytes($wpmempath,[System.Convert]::FromBase64String($wpmem))
Write-Output "[*] Collecting Memory Image`n`t$oppath"
& $wpmempath $oppath | out-null

# Get the MFT exported
$MftExportBase64 = ''
Write-Output "[*] Getting Master File Table"
Invoke-Expression ([System.Text.Encoding]::Ascii.GetString([System.Convert]::FromBase64String($MftExportBase64)))

# Get a list of running processes
$oppath = $($outputbase + '\system\processes.csv')
Write-Output "[*] Getting Process Listing`n`t$oppath"
Get-WmiObject win32_process | select CreationDate,Name,ProcessId,ParentProcessId,ExecutablePath,CommandLine | epcsv $oppath -NoTypeInformation

# Get a list of network connections
$oppath = $($outputbase + '\network\networkconnections.csv')
Write-Output "[*] Getting Network Connections`n`t$oppath"
Get-NetTCPConnection | select CreationTime,LocalAddress,LocalPort,RemoteAddress,RemotePort,OwningProcess,State | epcsv $oppath -NoTypeInformation

# Get persistence mechanisms with Microsoft SysInternals Autoruns
$autorunspath = $outputbase + '\Tools\autorunsc64.exe'
$oppath = $outputbase + '\system\autoruns.csv'
$MSSIAutorunsBase64 = ''
[io.file]::writeallbytes($autorunspath,[System.Convert]::FromBase64String($MSSIAutorunsBase64))
Write-Output "[*] Getting persistence mechanisms with Microsoft SysInternals Autoruns`n`t$oppath"
& $autorunspath -accepteula -nobanner -a bdehlmorstw -m -c -h -s -t -o $oppath | out-null

# Get Logon Sessions information
$oppath = $($outputbase + '\users\logonsessions.csv')
Write-Output "[*] Getting Logon Sessions`n`t$oppath"
Get-WmiObject win32_logonsession | select StartTime,Name,LogonId,LogonType,AuthenticationPackage,Status,Caption,Description | epcsv $oppath -NoTypeInformation

# Get User Account information
$oppath = $($outputbase + '\users\useraccounts.csv')
Write-Output "[*] Getting User Accounts`n`t$oppath"
Get-WmiObject win32_useraccount | select Domain,Name,Disabled,Lockout,PasswordChangeable,PasswordRequired,SID,Description | epcsv $oppath -NoTypeInformation

# Get Network Login Profile information
$oppath = $($outputbase + '\users\networkloginprofiles.csv')
Write-Output "[*] Getting Network Login Profiles`n`t$oppath"
Get-WmiObject win32_networkloginprofile | select Name,UserId,Privileges,LastLogon,LastLogoff,LogonServer,NumberOfLogons,PrimaryGroupId,AccountExpires,PasswordAge,PasswordExpires,BadPasswordCount,HomeDirectory | epcsv $oppath -NoTypeInformation

# Get a list of services
$oppath = $($outputbase + '\system\services.csv')
Write-Output "[*] Getting Service Listing`n`t$oppath"
Get-WmiObject win32_service | select Name,DisplayName,State,ProcessId,StartMode,ServiceType,StartName,Caption,Description | epcsv $oppath -NoTypeInformation

# Get Network Share information
$oppath = $($outputbase + '\network\shares.csv')
Write-Output "[*] Getting Network Shares`n`t$oppath"
Get-WmiObject win32_share | select Name,Path,Status,Caption,Description | epcsv $oppath -NoTypeInformation

# Get Environment information
$oppath = $($outputbase + '\system\environment.csv')
Write-Output "[*] Getting Environment Variables`n`t$oppath"
Get-WmiObject win32_environment | select UserName,Name,VariableValue | epcsv $oppath -NoTypeInformation

# Get Timezone information
$oppath = $($outputbase + '\system\timezone.csv')
Write-Output "[*] Getting Timezone Information`n`t$oppath"
Get-Timezone | select Id,DisplayName,StandardName,DaylightName,BaseUtcOffset,SupportsDaylightSavingTime | epcsv $oppath -NoTypeInformation

# Get Operating System information
$oppath = $($outputbase + '\system\operatingsystem.csv')
Write-Output "[*] Getting Operating System Information`n`t$oppath"
Get-WmiObject win32_operatingsystem | select Caption,CSName,InstallDate,LastBootUpTime,LocalDateTime,OSArchitecture,SerialNumber,Version | epcsv $oppath -NoTypeInformation

# Get Computer System information
$oppath = $($outputbase + '\system\computersystem.csv')
Write-Output "[*] Getting Computer System Information`n`t$oppath"
Get-WmiObject win32_computersystem | select Name,DNSHostName,UserName,Workgroup,Domain,TotalPhysicalMemory,CurrentTimeZone,DaylightInEffect,SystemType,Model,Manufacturer | epcsv $oppath -NoTypeInformation

# Get Disk Drive information
$oppath = $($outputbase + '\system\diskdrives.csv')
Write-Output "[*] Getting Disk Drive Listing`n`t$oppath"
Get-WmiObject win32_diskdrive | select Name,InterfaceType,Size,Partitions,Model,Caption,DeviceId,FirmwareRevision,SerialNumber,Description,MediaType,Status,PNPDeviceID | epcsv $oppath -NoTypeInformation

# Get Volume information
$oppath = $($outputbase + '\system\volumes.csv')
Write-Output "[*] Getting Volume Listing`n`t$oppath"
Get-WmiObject win32_volume | select Name,DeviceID,FileSystem,BootVolume,SystemVolume,Capacity,FreeSpace,Label,Automount | epcsv $oppath -NoTypeInformation

# Get Shadow Copy information
$oppath = $($outputbase + '\system\shadowcopies.csv')
Write-Output "[*] Getting Shadow Copy Listing`n`t$oppath"
Get-WmiObject win32_shadowcopy | select InstallDate,ID,DeviceObject,Persistent,ClientAccessible | epcsv $oppath -NoTypeInformation

# Get Quick Fix Engineering (Hotfix) information
$oppath = $($outputbase + '\system\quickfixengineering.csv')
Write-Output "[*] Getting QFE Hotfix Listing`n`t$oppath"
Get-WmiObject win32_quickfixengineering | select InstallDate,HotFixID,InstalledBy,Name,Caption,ServicePackInEffect,FixComments,Description | epcsv $oppath -NoTypeInformation

# Get Boot Configuration information
$oppath = $($outputbase + '\system\bootconfiguration.csv')
Write-Output "[*] Getting Boot Configuration`n`t$oppath"
Get-WmiObject win32_bootconfiguration | select Name,BootDirectory,Caption,Description | epcsv $oppath -NoTypeInformation

# Get Installed Software information
$oppath = $($outputbase + '\system\installedsoftware.csv')
Write-Output "[*] Getting Installed Software Listing`n`t$oppath"
Get-WmiObject win32_product | select InstallDate,Name,Version,Vendor,Caption,InstallSource,LocalPackage,PackageCache,PackageName,IdentifyingNumber,Description | epcsv $oppath -NoTypeInformation

# Get Network Adapter Configurations
$oppath = $($outputbase + '\Network\adapterconfiguration.csv')
Write-Output "`"Caption`",`"DNSHostname`",`"DNSServerSearchOrder`",`"DNSEnabledForWINSResolution`",`"IPEnabled`",`"IPAddress`",`"IPSubnet`",`"DefaultIPGateway`",`"DHCPServer`",`"DHCPLeaseObtained`",`"DHCPLeaseExpires`",`"MACAddress`",`"WINSEnableLMHostsLookup`",`"InterfaceIndex`",`"Index`",`"ServiceName`"" | out-file $oppath
Write-Output "[*] Getting Network Adapter Configurations`n`t$oppath"
$adapterconfigs = Get-WmiObject win32_networkadapterconfiguration | select Caption,DNSHostname,DNSServerSearchOrder,DNSEnabledForWINSResolution,IPEnabled,IPAddress,IPSubnet,DefaultIPGateway,DHCPServer,DHCPLeaseObtained,DHCPLeaseExpires,MACAddress,WINSEnableLMHostsLookup,InterfaceIndex,Index,ServiceName
foreach ($adapter in $adapterconfigs) {
    $adapterips = $adapter.IPAddress
    $dnsorder = $adapter.DNSServerSearchOrder
    $defaultgateway = $adapter.DefaultIPGateway
    $ipsubnets = $adapter.IPSubnet

    $outline = "`"$($adapter.caption)`",`"$($adapter.DNSHostname)`",`""
    if ($dnsorder.length -eq 0) { $outline += ',' }
    else {
        foreach ($dns in $dnsorder) {
            $outline += $dns + ','
        }
    }
    $outline = $outline -replace ',$','",'
    $outline += "`"$($adapter.DNSEnabledForWINSResolution)`",`"$($adapter.IPEnabled)`",`""
    if ($adapterips.length -eq 0) { $outline += ',' }
    else {
        foreach ($ip in $adapterips) {
            $outline += $ip + ','
        }
    }
    $outline = $outline -replace ',$','","'
    if ($ipsubnets.length -eq 0) { $outline += ',' }
    else {
        foreach ($subnet in $ipsubnets) {
            $outline += $subnet + ','
        }
    }
    $outline = $outline -replace ',$','","'
    if ($defaultgateway.length -eq 0) { $outline += ',' }
    else {
        foreach ($gateway in $defaultgateway) {
            $outline += $gateway + ','
        }
    }
    $outline = $outline -replace ',$','","'
    $outline += "$($adapter.DHCPServer)`",`"$($adapter.DHCPLeaseObtained)`",`"$($adapter.DHCPLeaseExpires)`",`"$($adapter.MACAddress)`",`"$($adapter.WINSEnableLMHostsLookup)`",`"$($adapter.InterfaceIndex)`",`"$($adapter.Index)`",`"$($adapter.ServiceName)`""
    $outline | out-file $oppath -append
}

# Get Scheduled Task information
$oppath = $($outputbase + '\system\scheduledtasks.csv')
Write-Output "[*] Getting Scheduled Task List`n`t$oppath"
write-output '"Date","TaskName","State","Principal","TaskPath","URI","Author","Version","CommandLine"' | out-file $oppath
get-scheduledtask | % { $task=$_; $actions=$_.actions; write-output "`"$($task.date)`",`"$($task.taskname)`",`"$($task.state)`",`"$($task.principal)`",`"$($task.taskpath)`",`"$($task.uri)`",`"$($task.author)`",`"$($task.version)`",`"$($actions.execute) $($actions.arguments)`"" | out-file $oppath -append }

# Get potential payloads
$oppath = $($outputbase + '\Interesting\potentialpayloads.csv')
Write-Output "[*] Finding Potentially Interesting Payloads`n`t$oppath"
$payloads = Get-ChildItem C:\Users\ -force -recurse -erroraction silentlycontinue | ? creationtime -gt ([datetime]::now).adddays(-7) | ? name -match '\.(exe|dll|hta|vbs|ps1|msi|bat)$' | ? fullname -notmatch 'microsoft|feedback|packages|repos|\\\.[^\\]\\|vs_' | ? length -lt 5mb | sort -property length -unique | select fullname,name,creationtimeutc
$payloads | epcsv $oppath -NoTypeInformation
foreach ($p in $payloads) { copy $($p.fullname) $($outputbase + '\interesting\' + $p.name) -force }

# Get Prefetch, if it exists
try {
    $pfpathsrc = 'C:\windows\prefetch'
    $pfpathdst = $($outputbase + '\System\Prefetch')
    if (test-path $pfpathsrc) {
        mkdir $pfpathdst -force | out-null
        Write-Output "[*] Getting Prefetch Files`n`t$pfpathdst"
        ls $pfpathsrc\*.pf -erroraction SilentlyContinue | copy -Destination $pfpathdst -erroraction SilentlyContinue
    }
}
catch { write-output "[!] Error: Could not copy Windows Prefetch files" }

# Create a shadow copy of the "C" Drive
$tsid = ''
$scpath = 'C:\ShadowCopy-C'
try {
    Write-Output "[*] Creating volume shadow copy for C:\ drive`n`t$scpath"
    $tsid = (invoke-wmimethod win32_shadowcopy -name create 'ClientAccessible',"C:\").shadowid
    $dopath = (get-wmiobject win32_shadowcopy | ? id -eq $tsid).deviceobject + '\'
    & cmd.exe /c mklink /d $scpath $dopath | out-null

    # Sleep for 3 seconds
    Sleep -seconds 3

    # Get Event Logs, if possible
    try {
        $elpathsrc = 'C:\ShadowCopy-C\Windows\System32\Winevt\Logs'
        $elpathdst = $($outputbase + '\Eventlogs')
        if (test-path $elpathsrc) {
            mkdir $elpathdst -force | out-null
            Write-Output "[*] Getting Windows Event Logs`n`t$elpathdst"
            ls $elpathsrc\*.evtx -erroraction silentlycontinue | copy -Destination $elpathdst -force -erroraction silentlycontinue
        }
    }
    catch { write-output "[!] Error: Could not copy Windows Event Logs" }

    # Get Hives and SRUMDB, if possible
    try {
        $regpathsrc = 'C:\ShadowCopy-C\Windows\System32\Config'
        $amcachesrc = 'C:\ShadowCopy-C\Windows\AppCompat\Programs\Amcache.hve'
        $srumdbsrc = 'C:\ShadowCopy-C\Windows\System32\SRU\SRUDB.dat'
        $hivepathdst = $($outputbase + '\Registry')
        if (test-path $regpathsrc) {
            mkdir $hivepathdst -force | out-null
            Write-Output "[*] Getting Windows Registry Hives`n`t$hivepathdst"
            copy-item -path $regpathsrc\SAM -Destination $hivepathdst -force -erroraction SilentlyContinue
            copy-item -path $regpathsrc\SECURITY -Destination $hivepathdst -force -erroraction SilentlyContinue
            copy-item -path $regpathsrc\SYSTEM -Destination $hivepathdst -force -erroraction SilentlyContinue
            copy-item -path $regpathsrc\SOFTWARE -Destination $hivepathdst -force -erroraction SilentlyContinue
        }
        if (test-path $amcachesrc) { copy-item -path $amcachesrc -Destination $hivepathdst -force -erroraction SilentlyContinue }
        if (test-path $srumdbsrc) { copy-item -path $srumdbsrc -Destination $hivepathdst -force -erroraction SilentlyContinue }
    }
    catch { write-output "[!] Error: Could not copy Windows Registry Hives" }

    # Get User Data, if possible
    try {
        $userpathsrc = 'C:\ShadowCopy-C\Users'
        $userpathdst = $($outputbase + '\Users')
        if (test-path $regpathsrc) {
            mkdir $userpathdst -force | out-null
            $userfiles = Get-ChildItem $userpathsrc -force -recurse -erroraction silentlycontinue | ? name -match '^(ntuser|usrclass|webcachev.{1,2})\.dat$|^(places\.sqlite|history|bookmarks|Media History|(Automatic|Custom)Destinations|logins\.json|(Login|Web) Data|WordWheelQuery|SystemIndex|Windows\.edb|Network Action Predictor|ActivitiesCache\.db)$'
            Write-Output "[*] Getting User Data`n`t$userpathdst`n"
            foreach ($f in $userfiles) {
                try {
                    $tdpath = ''
                    $tdfile = ''
                    if ($($f.fullname) -match '\\users(\\.+)\\([^\\]+)') { $tdpath = $userpathdst + $($matches[1]); $tdfile = $($matches[2]) }
                    mkdir $tdpath -force | out-null
                    copy-item $($f.fullname) $tdpath\$tdfile -force
                    write-output "[*] Retrieved file successfully: $tdpath\$tdfile"
                }
                catch { write-output "[!] Error: Could not copy file: $($f.fullname) to destination`n`t$($tdpath)" }
            }
        }
    }
    catch { write-output "[!] Error: Could not copy user data" }
}
catch { write-output "[!] Error: Could not create shadow copy" }

Write-output ""

# Remove possible system, hidden, or read-only flags
Get-ChildItem $outputbase -force -recurse | ? mode -match '[shr]' | % { & attrib.exe -s -h -r $($_.fullname) }

# Remove empty files
Write-Output "[*] Removing empty files that were collected`n"
$emptyfiles = Get-ChildItem $outputbase -force -recurse | ? length -eq 0
$emptyfiles | select -ExpandProperty fullname | out-file "$outputbase\deleted_empty_files.txt"
$emptyfiles | ri

# Clean up volume shadow copy and tools folder
Write-Output "[*] Cleaning up shadow copy $tsid and directory $scpath`n"
& cmd.exe /c rmdir $scpath
& vssadmin.exe delete shadows /shadow="$tsid" /quiet | out-null
if (test-path $($outputbase + '\Tools')) { rmdir $($outputbase + '\Tools') -force -recurse }

# Compress folder
$ttime = [datetime]::UtcNow
$opzippath = 'C:\' + $($ttime.year) + '-' + $($ttime.month) + '-' + $($ttime.day) + '_' + $($ttime.hour) + '_' + $($ttime.minute) + '_' + $($ttime.second) + '-' + $($env:COMPUTERNAME) + '_TriageCollection.zip'
$SevenZipBase64 = ''
$SevenZipArchivePath = 'C:\7zip.zip'
$SevenZipBasePath = 'C:\7zip'
$SevenZipExe = $SevenZipBasePath + '\7za.exe'
[io.file]::writeallbytes($SevenZipArchivePath,[System.Convert]::FromBase64String($SevenZipBase64))
Expand-Archive -path $SevenZipArchivePath -DestinationPath $SevenZipBasePath -force
write-output "[*] Compressing folder `"$outputbase`" to archive path `"$opzippath`"`n"
& $SevenZipExe a -tzip $opzippath $outputbase  | out-null

# Remove C:\ForensicTriage folder and 7zip
write-output "[*] Removing folder `"$outputbase`"`n"
rmdir $outputbase -force -recurse -erroraction silentlycontinue | out-null
rmdir $SevenZipBasePath -force -recurse -erroraction silentlycontinue | out-null
rm $SevenZipArchivePath -force -erroraction SilentlyContinue | out-null

Write-Output "[*] Cleanup finished`n"
Write-output "[*] Script finished at $(([datetime]::UtcNow).tostring())`n"